import React from 'react';
import {Link} from 'react-router-dom'

export default function main ({history}){
        return(
                <div>
            <div>main</div>
            <Link to ="/">Click to go HTTPSERVER</Link>
            <button 
            onClick={()=>{
                history.push('/')
            }}>Click to go to HTTPSERVER</button>
            </div>
           
        )
    }
